pD("common/dequeue.effekt",'module dequeue\n\n\n/// An implementation of a functional dequeue, using Okasaki\'s\n/// bankers dequeue implementation.\n///\n/// Translation from the Haskell implementation:\n///   https://hackage.haskell.org/package/dequeue-0.1.12/docs/src/Data-Dequeue.html#Dequeue\nrecord Dequeue[R](front: List[R], frontSize: Int, rear: List[R], rearSize: Int)\n\ndef emptyQueue[R](): Dequeue[R] \x3d Dequeue(Nil(), 0, Nil(), 0)\n\ndef isEmpty[R](dq: Dequeue[R]): Bool \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e (fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 0)\n}\n\ndef size[R](dq: Dequeue[R]): Int \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e fs + rs\n}\n\ndef first[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 1)) { r.headOption }\n      else { f.headOption }\n}\n\ndef last[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 1) \x26\x26 (rs \x3d\x3d 0)) { f.headOption }\n      else { r.headOption }\n}\n\ndef check[R](dq: Dequeue[R]): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n        val c \x3d 4;\n        val size1 \x3d (fs + rs) / 2;\n        val size2 \x3d (fs + rs) - size1;\n\n        if (fs \x3e c * rs + 1) {\n            val front \x3d f.take(size1);\n            val rear \x3d r.append(f.drop(size1).reverse);\n            Dequeue(front, size1, rear, size2)\n        } else if (rs \x3e c * fs + 1) {\n            val front \x3d f.append(r.drop(size1).reverse);\n            val rear \x3d r.take(size1);\n            Dequeue(front, size2, rear, size1)\n        } else {\n            dq\n        }\n}\n\ndef pushFront[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(Cons(el, f), fs + 1, r, rs).check\n}\n\ndef popFront[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Nil(), fs, Cons(x, Nil()), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(Nil(), fs, r, rs) \x3d\x3e\n        None()\n    case Dequeue(Cons(x, rest), fs, r, rs) \x3d\x3e\n        Some((x, Dequeue(rest, fs - 1, r, rs).check))\n}\n\ndef pushBack[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(f, fs, Cons(el, r), rs + 1).check\n}\n\ndef popBack[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Cons(x, Nil()), fs, Nil(), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(f, fs, Nil(), rs) \x3d\x3e\n        None()\n    case Dequeue(f, fs, Cons(x, rest), rs) \x3d\x3e\n        Some((x, Dequeue(f, fs, rest, rs - 1).check))\n}\n\n\ndef show[A](d: Dequeue[A]) { showA: A \x3d\x3e String }: String \x3d {\n  val Dequeue(front, frontSize, rear, rearSize) \x3d d;\n  "Dequeue(" ++ show(front){showA} ++ ", " ++ show(frontSize) ++ ", " ++\n      show(rear){showA} ++ ", " ++ show(rearSize) ++ ")"\n}\ndef show(l: Dequeue[Int]): String \x3d show(l) { e \x3d\x3e show(e) }\ndef show(l: Dequeue[Double]): String \x3d show(l) { e \x3d\x3e show(e) }\ndef show(l: Dequeue[Bool]): String \x3d show(l) { e \x3d\x3e show(e) }\ndef show(l: Dequeue[String]): String \x3d show(l) { e \x3d\x3e e }\n\ndef println(l: Dequeue[Int]): Unit \x3d println(show(l))\ndef println(l: Dequeue[Double]): Unit \x3d println(show(l))\ndef println(l: Dequeue[Bool]): Unit \x3d println(show(l))\ndef println(l: Dequeue[String]): Unit \x3d println(show(l))\n');
pD("common/exception.effekt",'module exception\n\nimport effekt\n\n// Exceptions\n// \x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\n\ninterface Exception[E] {\n  def raise(exception: E, msg: String): Nothing\n}\n\ndef raise[A, E](exception: E, msg: String): A / Exception[E] \x3d\n  do raise(exception, msg) match {}\n\n/**\n * Used as a type for `Exception` in functions which expect a non-empty\n * container (e.g. option or list).\n */\nrecord MissingValue()\n\ndef missingValue(): Nothing / Exception[MissingValue] \x3d\n  do raise(MissingValue(), "Missing value.")\n\n/**\n * Used as a type for `Exception` in functions where an index can be out of bounds.\n */\nrecord OutOfBounds()\n\n/**\n * Unexpected runtime exceptions that can be caught.\n */\nrecord RuntimeError()\n\ndef raise[A](msg: String): A / Exception[RuntimeError] \x3d\n  do raise(RuntimeError(), msg) match {}\n\n/**\n * Used as a type for `Exception` in functions which expect the input\n * to be formatted in a specific way.\n */\nrecord WrongFormat()\n\ndef wrongFormat(): Nothing / Exception[WrongFormat] \x3d\n  do raise(WrongFormat(), "Wrong format.")\n\ndef wrongFormat(msg: String): Nothing / Exception[WrongFormat] \x3d\n  do raise(WrongFormat(), msg)\n\n\n/**\n * A fatal runtime error that cannot be caught\n */\nextern io def panic(msg: String): Nothing \x3d\n  js "(function() { throw ${msg} })()"\n  chez "(raise ${msg})"\n  llvm !!!MULTILINEMARKER!!!\n    call void @c_io_println_String(%Pos ${msg})\n    call void @exit(i32 1)\n    ret %Pos zeroinitializer ; Unit\n  !!!MULTILINEMARKER!!!\n\n\n// Exception Handlers\n// \x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\n\n\n/**\n * Converts exceptions of (static) type E to an uncatchable panic that aborts the program\n */\ndef panicOn[E, T] { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d panic(msg) }\n\n/**\n * Reports exceptions of (static) type E to the console\n */\ndef report[E] { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d println(msg) }\n\n/**\n * Ignores exceptions of (static) type E\n */\ndef ignore[E] { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d () }\n\n/**\n * Use the default value to handle the exception of type E\n */\ndef default[E, T] { default: \x3d\x3e T } { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d default() }\n\n/**\n * Runs the finalizer and rethrows E\n */\ndef finalize[E, T] { finalizer: \x3d\x3e Unit } { prog: \x3d\x3e T / Exception[E] }: T / Exception[E] \x3d\n  try { val res \x3d prog(); finalizer(); res } with Exception[E] {\n    def raise(exception: E, msg: String) \x3d { finalizer(); do raise(exception, msg) }\n  }\n\n/**\n * A proxy value to enable partial type applications, such as:\n *\n * ```\n * with on[MissingValue].ignore; ...\n * ```\n */\nrecord on[E]()\n\ndef ignore[E](proxy: on[E]) { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  ignore[E] {prog}\n\ndef default[E, T](proxy: on[E]) { d: \x3d\x3e T } { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  default[E, T] {d} {prog}\n\ndef panic[E, T](proxy: on[E]) { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  panicOn[E, T] {prog}\n\ndef report[E](proxy: on[E]) { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  report[E] {prog}\n\ndef finalize[E, T](proxy: on[E]) { finalizer: \x3d\x3e Unit } { prog: \x3d\x3e T / Exception[E] }: T / Exception[E] \x3d\n  finalize[E, T] {finalizer} {prog}');
pD("common/result.effekt",'module result\n\nimport effekt\nimport option\nimport exception\n\n/// Represents the result of a potentially failing computation.\n/// It is the "reification" of the Exception[E] effect.\ntype Result[A, E] {\n  Error(exception: E, msg: String);\n  Success(a: A)\n}\n\n/// Represent ("reify") the result of a potentially failing computation.\ndef result[A, E] { f: \x3d\x3e A / Exception[E] }: Result[A, E] \x3d try {\n  Success(f())\n} with Exception[E] {\n  def raise(exc, msg) \x3d Error(exc, msg)\n}\ndef result[A, E](proxy: on[E]) { f: \x3d\x3e A / Exception[E] }: Result[A, E] \x3d try {\n  Success(f())\n} with Exception[E] {\n  def raise(exc, msg) \x3d Error(exc, msg)\n}\n\n/// Extracts the value of a result, if available\n/// Monadic "reflection"\ndef value[A, E](r: Result[A, E]): A / Exception[E] \x3d r match {\n  case Success(a) \x3d\x3e a\n  case Error(exc, msg) \x3d\x3e do raise(exc, msg)\n}\n\n/// Converts a result to an option forgetting the error details\ndef toOption[A, E](r: Result[A, E]): Option[A] \x3d r match {\n  case Success(a) \x3d\x3e Some(a)\n  case Error(exc, msg) \x3d\x3e None()\n}\n');
pD("common/resizable_array.effekt",'module resizable_array\n\nimport ref\nimport array\n\nrecord ResizableArray[T](rawSizePtr: Ref[Int], rawContentPtr: Ref[Array[T]])\n\n// These numbers should be optimized based on benchmarking\n// According to https://en.wikipedia.org/wiki/Dynamic_array most use 1.5 or 2\n\n/// Factor by which to grow the capacity when it becomes too small\nval growFactor \x3d 1.5\n/// shrink array when size / capacity falls below this threshold\n/// should be \x3c 1/growFactor\nval shrinkThreshold \x3d 0.4\n\n/// Number of elements in the dynamic array\n///\n/// O(1)\ndef size[T](arr: ResizableArray[T]) \x3d arr.rawSizePtr.get\n\n/// Allocate a new, empty dynamic array with given initial capacity\ndef resizableArray[T](capacity: Int): ResizableArray[T] \x3d {\n  ResizableArray(ref(0), ref(allocate(capacity)))\n}\n\n/// Allocate a new, empty dynamic array\ndef resizableArray[T](): ResizableArray[T] \x3d resizableArray(8)\n\n/// Throw an OutOfBounds exception if index is not a valid index into arr\ndef boundsCheck[T](arr: ResizableArray[T], index: Int): Unit / Exception[OutOfBounds] \x3d {\n  if (index \x3c 0 || index \x3e\x3d arr.size) {\n    do raise(OutOfBounds(), "Array index out of bounds: " ++ show(index))\n  }\n}\n\n/// get the element at position index in the array\n///\n/// precondition: index is a valid index into the array\n///\n/// O(1)\ndef unsafeGet[T](arr: ResizableArray[T], index: Int): T \x3d {\n  arr.rawContentPtr.get.unsafeGet(index)\n}\n/// get the element at position index in the array\n///\n/// O(1)\ndef get[T](arr: ResizableArray[T], index: Int): T / Exception[OutOfBounds] \x3d {\n  arr.boundsCheck(index);\n  arr.unsafeGet(index)\n}\n\n/// set the element at position index in the array\n///\n/// precondition: index is a valid index into the array\n///\n/// O(1)\ndef unsafeSet[T](arr: ResizableArray[T], index: Int, value: T): Unit \x3d {\n  arr.rawContentPtr.get.unsafeSet(index, value)\n}\n\n/// set the element at position index in the array\n///\n/// O(1)\ndef set[T](arr: ResizableArray[T], index: Int, value: T): Unit / Exception[OutOfBounds] \x3d {\n  arr.boundsCheck(index);\n  arr.unsafeSet(index, value)\n}\n\n/// swap the elements at the given positions in the array\n///\n/// precondition: both are valid indices into the array\n///\n/// O(1)\ndef unsafeSwap[T](arr: ResizableArray[T], index1: Int, index2: Int): Unit \x3d {\n  val raw \x3d arr.rawContentPtr.get\n  val tmp \x3d raw.unsafeGet(index1)\n  raw.unsafeSet(index1, raw.unsafeGet(index2))\n  raw.unsafeSet(index2, tmp)\n}\n\n/// swap the elements at the given positions in the array\n///\n/// O(1)\ndef swap[T](arr: ResizableArray[T], index1: Int, index2: Int): Unit / Exception[OutOfBounds] \x3d {\n  arr.boundsCheck(max(index1, index2))\n  arr.unsafeSwap(index1, index2)\n}\n\n/// Change the dynamic to have exactly the given capacity\n///\n/// precondition: given capacity is at least the size of the array\n///\n/// O(n)\ndef unsafeSetCapacity[T](arr: ResizableArray[T], capacity: Int): Unit \x3d {\n  with on[OutOfBounds].panic\n  val oldRaw \x3d arr.rawContentPtr.get\n  if (oldRaw.size !\x3d capacity) { \n    val newRaw \x3d array::allocate(capacity)\n    oldRaw.copy(0, newRaw, 0, arr.size)\n    arr.rawContentPtr.set(newRaw)\n  }\n}\n\n/// Change the resizable array to have exactly the given capacity.\n/// This only changes the size of the backing array, not the `size`.\n///\n/// O(n)\ndef setCapacity[T](arr: ResizableArray[T], capacity: Int): Unit / Exception[OutOfBounds] \x3d {\n  if (arr.size \x3e capacity) {\n    do raise(OutOfBounds(), "Cannot change capacity of ResizableArray to " ++ capacity.show ++ " below size " ++ arr.size.show)\n  }\n  arr.unsafeSetCapacity(capacity)\n}\n\n/// If the shrinkThreshold is reached, shrink by growFactor, otherwise do nothing\n///\n/// O(n)\ndef maybeShrink[T](arr: ResizableArray[T]): Unit \x3d {\n  if(arr.size.toDouble \x3c arr.rawContentPtr.get.size.toDouble * shrinkThreshold) {\n    val newCap \x3d max(arr.size, (arr.rawContentPtr.get.size.toDouble / growFactor).ceil)\n    arr.unsafeSetCapacity(newCap)\n  }\n}\n\n/// makes sure capacity is at least the given one\n///\n/// O(given capacity - current capacity) amortized, O(n) worst case // TODO ?\ndef ensureCapacity[T](arr: ResizableArray[T], capacity: Int): Unit / Exception[OutOfBounds] \x3d {\n  if (arr.rawContentPtr.get.size \x3c capacity) {\n    val curCapd: Double \x3d arr.rawContentPtr.get.size.toDouble\n    val minGrowCapacity: Int \x3d (curCapd * growFactor + 1.0).toInt\n    val newCapacity \x3d max(capacity, minGrowCapacity)\n    arr.setCapacity(newCapacity)\n  }\n}\n\n/// Set the value at given position, resizing if necessary\n/// Note: New elements might be uninitialized!!!\n///\n/// O(max(1,index - n)) amortized, O(n) worst case if index \x3e capacity\ndef setResizing[T](arr: ResizableArray[T], index: Int, value: T): Unit / Exception[OutOfBounds] \x3d {\n  if (index \x3c 0) {\n    do raise(OutOfBounds(), "Negative index " ++ index.show)\n  }\n  if (index \x3c arr.size) {\n    arr.rawContentPtr.get.unsafeSet(index, value)\n  }\n  ensureCapacity(arr, index + 1)\n  arr.rawContentPtr.get.unsafeSet(index, value)\n  arr.rawSizePtr.set(index + 1)\n}\n\n/// Add a new element at the end of the resizable array.\n/// Return the index of the new element\n///\n/// O(1) amortized, O(n) worst case\ndef add[T](arr: ResizableArray[T], value: T): Int \x3d {\n  with on[OutOfBounds].panic();\n  val idx \x3d arr.size\n  arr.setResizing(idx, value)\n  idx\n}\n\n/// Remove and return the rightmost element in the resizable array.\n///\n/// O(1) amortized, O(n) worst case\ndef popRight[T](arr: ResizableArray[T]): T / Exception[OutOfBounds] \x3d {\n  arr.boundsCheck(arr.size - 1)\n  arr.rawSizePtr.set(arr.size - 1)\n  val r \x3d arr.unsafeGet(arr.size)\n  arr.maybeShrink()\n  r\n}\n\n\ndef foreachIndex[T](arr: ResizableArray[T]){ body: (Int, T) \x3d\x3e Unit }: Unit \x3d {\n  each(0, arr.size) { i \x3d\x3e\n    body(i, arr.rawContentPtr.get.unsafeGet(i))\n  }\n}\ndef foreachIndex[T](arr: ResizableArray[T]){ body: (Int, T) {Control} \x3d\x3e Unit }: Unit \x3d {\n  each(0, arr.size) { (i){label} \x3d\x3e\n    body(i, arr.rawContentPtr.get.unsafeGet(i)){label}\n  }\n}\ndef foreach[T](arr: ResizableArray[T]){ body: T \x3d\x3e Unit }: Unit \x3d {\n  each(0, arr.size) { i \x3d\x3e\n    body(arr.rawContentPtr.get.unsafeGet(i))\n  }\n}\ndef foreach[T](arr: ResizableArray[T]){ body: (T) {Control} \x3d\x3e Unit }: Unit \x3d {\n  each(0, arr.size) { (i){label} \x3d\x3e\n    body(arr.rawContentPtr.get.unsafeGet(i)){label}\n  }\n}\ndef foreachIndexReversed[T](arr: ResizableArray[T]){ body: (Int, T){Control} \x3d\x3e Unit }: Unit \x3d {\n  var i \x3d arr.size - 1\n  loop { {l} \x3d\x3e\n    if (i \x3c 0) { l.break() }\n    body(i, arr.rawContentPtr.get.unsafeGet(i)){l}\n    i \x3d i - 1\n  }\n}\ndef foreachIndexReversed[T](arr: ResizableArray[T]){ body: (Int, T) \x3d\x3e Unit }: Unit \x3d {\n  var i \x3d arr.size - 1\n  while(i \x3e\x3d 0) {\n    body(i, arr.rawContentPtr.get.unsafeGet(i))\n    i \x3d i - 1\n  }\n}\ndef foreachReversed[T](arr: ResizableArray[T]){ body: (T){Control} \x3d\x3e Unit }: Unit \x3d {\n  var i \x3d arr.size - 1\n  loop { {l} \x3d\x3e\n    if (i \x3c 0) { l.break() }\n    body(arr.rawContentPtr.get.unsafeGet(i)){l}\n    i \x3d i - 1\n  }\n}\ndef foreachReversed[T](arr: ResizableArray[T]){ body: T \x3d\x3e Unit }: Unit \x3d {\n  var i \x3d arr.size - 1\n  while (i \x3e\x3d 0) { \n    body(arr.rawContentPtr.get.unsafeGet(i))\n    i \x3d i - 1\n  }\n}\n\ndef toList[T](arr: ResizableArray[T]): List[T] \x3d {\n  def go(i: Int, acc: List[T]): List[T] \x3d {\n    if (i \x3c 0) { acc } else {\n      go(i - 1, Cons(arr.unsafeGet(i), acc))\n    }\n  }\n  go(arr.size - 1, Nil())\n}');
pD("common/heap.effekt","module heap\nimport resizable_array\n\n/// Resizable 2-ary min-heap, backed by a resizable array\n/// `cmp` defines the ordering of elements\nrecord Heap[T](rawContents: ResizableArray[T], cmp: (T, T) \x3d\x3e Ordering at {})\n\n/// Make a new Heap with the given comparison operation\ndef heap[T](cmp: (T,T) \x3d\x3e Ordering at {}) \x3d \n  Heap[T](resizableArray(), cmp)\n\n/// Make a new Heap with the given comparison operation and initial capacity\ndef heap[T](cmp: (T,T) \x3d\x3e Ordering at {}, capacity: Int) \x3d \n  Heap[T](resizableArray(capacity), cmp)\n\nnamespace internal {\n  def left(idx: Int) \x3d 2 * idx + 1\n  def right(idx: Int) \x3d 2 * idx + 2\n  def parent(idx: Int) \x3d (idx - 1) / 2\n\n  def bubbleUp[A](heap: Heap[A], idx: Int) \x3d {\n    val arr \x3d heap.rawContents\n    arr.boundsCheck(idx) // idx \x3e parent(idx), parent(parent(idx)) etc\n\n    def go(idx: Int): Unit \x3d {\n      if (idx \x3e 0 and (heap.cmp)(arr.unsafeGet(parent(idx)), arr.unsafeGet(idx)) is Greater()) {\n        arr.unsafeSwap(parent(idx), idx)\n        go(parent(idx))\n      }\n    }\n    go(idx)\n  }\n  def sinkDown[A](heap: Heap[A], idx: Int) \x3d {\n    val arr \x3d heap.rawContents\n\n    def infixLt(x: A, y: A) \x3d {\n      if ((heap.cmp)(x,y) is Less()) { true } else { false }\n    }\n    \n    def go(idx: Int): Unit \x3d {\n      if (right(idx) \x3c arr.size) {\n        val v \x3d arr.unsafeGet(idx)\n        val l \x3d arr.unsafeGet(left(idx))\n        val r \x3d arr.unsafeGet(right(idx))\n        if (l \x3c v \x26\x26 r \x3c v) {\n          // swap with the smaller one\n          if (l \x3c r) {\n            arr.unsafeSwap(left(idx), idx)\n            go(left(idx))\n          } else {\n            arr.unsafeSwap(right(idx), idx)\n            go(right(idx))\n          }\n        } else if (l \x3c v) {\n          arr.unsafeSwap(left(idx), idx)\n          go(left(idx))\n        } else if (r \x3c v) {\n          arr.unsafeSwap(right(idx), idx)\n          go(right(idx))\n        }\n      } else if (left(idx) \x3c arr.size) {\n        if (arr.unsafeGet(left(idx)) \x3c arr.unsafeGet(idx)) {\n          arr.unsafeSwap(left(idx), idx)\n          go(left(idx))\n        }\n      } // else: we are at the bottom\n    }\n    go(idx)\n  }\n}\n\n/// Insert value into heap\n///\n/// O(log n) worst case if capacity suffices, O(1) average\ndef insert[T](heap: Heap[T], value: T): Unit \x3d {\n  with on[OutOfBounds].panic();\n  val idx \x3d heap.rawContents.add(value)\n  internal::bubbleUp(heap, idx)\n}\n\n/// find and return (but not remove) the minimal element in this heap\n///\n/// O(1)\ndef findMin[T](heap: Heap[T]): T / Exception[OutOfBounds] \x3d {\n  heap.rawContents.get(0)\n}\n\n/// find and remove the minimal element in this heap\n///\n/// O(log n)\ndef deleteMin[T](heap: Heap[T]): T / Exception[OutOfBounds] \x3d {\n  val res \x3d heap.rawContents.get(0)\n  heap.rawContents.unsafeSet(0, heap.rawContents.popRight())\n  internal::sinkDown(heap, 0)\n  res\n}\n\n/// Number of elements in the heap\n///\n/// O(1)\ndef size[T](heap: Heap[T]): Int \x3d {\n  heap.rawContents.size\n}");
pD("common/io.effekt",'module io\n\nimport ref\nimport queue\n\n// Event Loop\n// ----------\n\ntype Task[T] \x3d () \x3d\x3e T at {io, async, global}\n\nextern llvm !!!MULTILINEMARKER!!!\n  declare void @c_yield(%Stack)\n!!!MULTILINEMARKER!!!\n\nextern async def spawn(task: Task[Unit]): Unit \x3d\n  js "$effekt.capture(k \x3d\x3e { setTimeout(() \x3d\x3e k($effekt.unit), 0); return $effekt.run(${task}) })"\n  llvm !!!MULTILINEMARKER!!!\n    call void @c_yield(%Stack %stack)\n    %unboxed \x3d call ccc %Neg @unbox(%Pos ${task})\n    call void @run(%Neg %unboxed)\n    ret void\n  !!!MULTILINEMARKER!!!\n\nextern async def yield(): Unit \x3d\n  js "$effekt.capture(k \x3d\x3e setTimeout(() \x3d\x3e k($effekt.unit), 0))"\n  llvm !!!MULTILINEMARKER!!!\n    call void @c_yield(%Stack %stack)\n    ret void\n  !!!MULTILINEMARKER!!!\n\nextern async def abort(): Nothing \x3d\n  js "$effekt.capture(k \x3d\x3e undefined)"\n  llvm !!!MULTILINEMARKER!!!\n    call void @eraseStack(%Stack %stack)\n    ret void\n  !!!MULTILINEMARKER!!!\n\n\n// Promises\n// --------\n\nextern type Promise[T]\n  // \x3d js "{resolve: \u0192, promise: Promise}"\n  // \x3d llvm "{tag: 0, obj: Promise*}"\n\ndef promise[T](task: Task[T]): Promise[T] \x3d {\n  val p \x3d promise::make[T]();\n  spawn(box { p.resolve(task()) });\n  return p\n}\n\nextern llvm !!!MULTILINEMARKER!!!\n  declare %Pos @c_promise_make()\n  declare void @c_promise_resolve(%Pos, %Pos)\n  declare void @c_promise_await(%Pos, %Neg)\n!!!MULTILINEMARKER!!!\n\nextern async def await[T](promise: Promise[T]): T \x3d\n  js "$effekt.capture(k \x3d\x3e ${promise}.promise.then(k))"\n  llvm !!!MULTILINEMARKER!!!\n    call void @c_promise_await(%Pos ${promise}, %Stack %stack)\n    ret void\n  !!!MULTILINEMARKER!!!\n\nextern async def resolve[T](promise: Promise[T], value: T): Unit \x3d\n  js "$effekt.capture(k \x3d\x3e { ${promise}.resolve(${value}); return k($effekt.unit) })"\n  llvm !!!MULTILINEMARKER!!!\n    call void @c_promise_resolve(%Pos ${promise}, %Pos ${value}, %Stack %stack)\n    ret void\n  !!!MULTILINEMARKER!!!\n\nnamespace promise {\n  extern js !!!MULTILINEMARKER!!!\n    function promise$make() {\n      let resolve;\n      const promise \x3d new Promise((res, rej) \x3d\x3e {\n        resolve \x3d res;\n      });\n      return { resolve: resolve, promise: promise };\n    }\n  !!!MULTILINEMARKER!!!\n\n  extern io def make[T](): Promise[T] \x3d\n    js "promise$make()"\n    llvm !!!MULTILINEMARKER!!!\n      %promise \x3d call %Pos @c_promise_make()\n      ret %Pos %promise\n    !!!MULTILINEMARKER!!!\n}\n');
pD("common/map.effekt",'module map\n\n/// Ordered finite immutable map, backed by balanced binary trees of logarithmic depth.\nrecord Map[K, V](tree: internal::Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {})\n\n/// Create a new empty map using a pure, first-class comparison function.\n///\n/// O(1)\ndef empty[K, V](compare: (K, K) \x3d\x3e Ordering at {}): Map[K, V] \x3d\n  Map(internal::empty(), compare)\n\n/// Create a new empty map using a generic comparison function.\n/// Only available on JavaScript backends!\n///\n/// O(1)\ndef emptyGeneric[K, V](): Map[K, V] \x3d\n  Map(\n    internal::empty(),\n    box { (left: K, right: K) \x3d\x3e genericCompare(left, right) }\n  )\n\n/// Check if map `m` is empty.\n///\n/// O(1)\ndef isEmpty[K, V](m: Map[K, V]): Bool \x3d internal::isEmpty(m.tree)\n\n/// Check if map `m` is nonempty.\n///\n/// O(1)\ndef nonEmpty[K, V](m: Map[K, V]): Bool \x3d internal::nonEmpty(m.tree)\n\n/// Create a new map containing the mapping from `k` to `v` and a pure, first-class comparison function.\n///\n/// O(1)\ndef singleton[K, V](k: K, v: V, compare: (K, K) \x3d\x3e Ordering at {}): Map[K, V] \x3d\n  Map(internal::singleton(k, v), compare)\n\n/// Create a new map containing the mapping from `k` to `v` using a generic comparison function.\n/// Only available on the JavaScript backends!\n///\n/// O(1)\ndef singletonGeneric[K, V](k: K, v: V): Map[K, V] \x3d\n  Map(\n    internal::singleton(k, v),\n    box { (left: K, right: K) \x3d\x3e genericCompare(left, right) }\n  )\n\n/// Get the size of the map (the number of keys/values).\n///\n/// O(1)\ndef size[K, V](m: Map[K, V]): Int \x3d internal::size(m.tree)\n\n/// Insert a new key `k` and value `v` into the map `m`.\n/// If the key `k` is already present in `m`, its associated value is replaced with `v`.\n///\n/// O(log N)\ndef put[K, V](m: Map[K, V], k: K, v: V): Map[K, V] \x3d {\n  val newTree \x3d internal::put(m.tree, m.compare, k, v)\n  Map(newTree, m.compare)\n}\n\n/// Insert a new key `k` and value `v` into the map `m`.\n/// If the key `k` is already present in `m` with value `v2`, the function `combine` is called on `k`, `v`, `v2`.\n///\n/// O(log N)\ndef putWithKey[K, V](m: Map[K, V], k: K, v: V) { combine: (K, V, V) \x3d\x3e V }: Map[K, V] \x3d {\n  val newTree \x3d internal::putWithKey(m.tree, m.compare, k, v) {combine}\n  Map(newTree, m.compare)\n}\n\n/// Lookup the value at a key `k` in the map `m`.\n///\n/// O(log N)\ndef get[K, V](m: Map[K, V], k: K): Option[V] \x3d internal::get(m.tree, m.compare, k)\n\n/// Lookup the value at a key `k` in the map `m`.\n/// If there is no key, use the `default` block to retrieve a default value.\n///\n/// O(log N)\ndef getOrElse[K, V](m: Map[K, V], k: K) { default: \x3d\x3e V }: V \x3d\n  internal::get(m.tree, m.compare, k) match {\n    case None() \x3d\x3e default()\n    case Some(v) \x3d\x3e v\n  }\n\n/// Check if map `m` contains a key `k`.\n///\n/// O(log N)\ndef contains[K, V](m: Map[K, V], k: K): Bool \x3d\n  internal::get(m.tree, m.compare, k) match {\n    case None() \x3d\x3e false\n    case Some(v) \x3d\x3e true\n  }\n\n/// Get minimum in the map `m`.\n///\n/// O(log N)\ndef getMin[K, V](m: Map[K, V]): Option[(K, V)] \x3d internal::getMin(m.tree)\n\n/// Get maximum in the map `m`.\n///\n/// O(log N)\ndef getMax[K, V](m: Map[K, V]): Option[(K, V)] \x3d internal::getMax(m.tree)\n\n/// Tree a function `f` over values in map `m`.\n///\n/// O(N)\ndef map[K, V1, V2](m: Map[K, V1]) { f: (K, V1) \x3d\x3e V2 }: Map[K, V2] \x3d {\n  val newTree \x3d internal::map(m.tree) {f}\n  Map(newTree, m.compare)\n}\n\n/// Tree a function `f` over values in map `m`.\n///\n/// O(N)\ndef map[K, V1, V2](m: Map[K, V1]) { f: V1 \x3d\x3e V2 }: Map[K, V2] \x3d {\n  m.map { (_k, v) \x3d\x3e f(v) }\n}\n\n/// Tree a function `f` over values in map `m`, keeping only the values where `f` returns `Some(...)`\n///\n/// O(N)\ndef mapMaybe[K, V1, V2](m: Map[K, V1]) { f: (K, V1) \x3d\x3e Option[V2] }: Map[K, V2] \x3d {\n  val newTree \x3d internal::mapMaybe(m.tree) {f}\n  Map(newTree, m.compare)\n}\n\n/// Filters a map `m` with a `shouldKeep` function,\n/// keeping only the elements where `shouldKeep` returns `true`.\n///\n/// Law: `m.filter { f } \x3d\x3d\x3d m.mapMaybe { (k, v) \x3d\x3e if (f(k, v)) Some(v) else None() }`\n///\n/// O(N)\ndef filter[K, V](m: Map[K, V]) { shouldKeep: (K, V) \x3d\x3e Bool }: Map[K, V] \x3d {\n  val newTree \x3d internal::filter(m.tree) {shouldKeep}\n  Map(newTree, m.compare)\n}\n\n/// Filters a map `m` with a `shouldKeep` function,\n/// keeping only the values where `shouldKeep` returns `true`.\n///\n/// O(N)\ndef filter[K, V](m: Map[K, V]) { shouldKeep: V \x3d\x3e Bool }: Map[K, V] \x3d\n  m.filter { (_k, v) \x3d\x3e shouldKeep(v) }\n\n/// Traverse all keys and their associated values in map `m` in order,\n/// running the function `action` on a key and its associated value.\n///\n/// Law: `m.foreach { action } \x3d\x3d\x3d m.toList.foreach { action }`\n///\n/// O(N)\n///\n/// TODO: Support {Control} for early exits.\ndef foreach[K, V](m: Map[K, V]) { action: (K, V) \x3d\x3e Unit }: Unit \x3d\n  internal::foreach(m.tree) {action}\n\n/// Convert a map `m` into a list of (key, value) pairs.\n///\n/// O(N)\ndef toList[K, V](m: Map[K, V]): List[(K, V)] \x3d {\n  var acc \x3d Nil()\n  m.foreach { (k, v) \x3d\x3e\n    acc \x3d Cons((k, v), acc)\n  }\n  acc.reverse\n}\n\n/// Get a list of keys of the map `m`.\n///\n/// O(N)\ndef keys[K, V](m: Map[K, V]): List[K] \x3d {\n  var acc \x3d Nil()\n  m.foreach { (k, _v) \x3d\x3e\n    acc \x3d Cons(k, acc)\n  }\n  acc.reverse\n}\n\n/// Get a list of values of the map `m`.\n///\n/// O(N)\ndef values[K, V](m: Map[K, V]): List[V] \x3d {\n  var acc \x3d Nil()\n  m.foreach { (_k, v) \x3d\x3e\n    acc \x3d Cons(v, acc)\n  }\n  acc.reverse\n}\n\n/// Create a map from a list of (key, value) pairs and a pure, first-class comparison function.\n/// If the list contains more than one value for the same key,\n/// only the last value is used in the map.\n///\n/// O(N) if the list is sorted by key,\n/// O(N log N) otherwise\ndef fromList[K, V](pairs: List[(K, V)], compare: (K, K) \x3d\x3e Ordering at {}): Map[K, V] \x3d\n  Map(internal::fromList(pairs, compare), compare)\n\n/// Create a map from a list of (key, value) pairs and a generic comparison function.\n/// If the list contains more than one value for the same key,\n/// only the last value is used in the map.\n/// Works only on JavaScript backends!\n///\n/// O(N) if the list is sorted by key,\n/// O(N log N) otherwise\ndef fromListGeneric[K, V](pairs: List[(K, V)]): Map[K, V] \x3d {\n  val compare: (K, K) \x3d\x3e Ordering at {} \x3d box { (left, right) \x3d\x3e genericCompare(left, right) }\n  Map(internal::fromList(pairs, compare), compare)\n}\n\n/// Remove a key `k` from a map `m`.\n/// If `k` is not in `m`, `m` is returned.\n///\n/// O(log N)\ndef delete[K, V](m: Map[K, V], k: K): Map[K, V] \x3d {\n  val newTree \x3d internal::delete(m.tree, m.compare, k)\n  Map(newTree, m.compare)\n}\n\n/// Can be used to insert, delete, or update a value.\n/// Law: `get(m.alter(k){f}, k) \x3d\x3d\x3d f(get(m, k))`\n///\n/// O(log N)\ndef alter[K, V](m: Map[K, V], k: K) { f: Option[V] \x3d\x3e Option[V] }: Map[K, V] \x3d {\n  val newTree \x3d internal::alter(m.tree, m.compare, k) {f}\n  Map(newTree, m.compare)\n}\n\n/// Update or delete a value associated with key `k` in map `m`.\n///\n/// O(log N)\ndef update[K, V](m: Map[K, V], k: K) { f: (K, V) \x3d\x3e Option[V] }: Map[K, V] \x3d {\n  val newTree \x3d internal::update(m.tree, m.compare, k) {f}\n  Map(newTree, m.compare)\n}\n\n/// Update or delete a value associated with key `k` in map `m`.\n///\n/// O(log N)\ndef update[K, V](m: Map[K, V], k: K) { f: V \x3d\x3e Option[V] }: Map[K, V] \x3d\n  m.update(k) { (_k, v) \x3d\x3e f(v) }\n\n/// Get `n`-th (key, value) pair in the map `m`.\n///\n/// O(log N)\ndef getIndex[K, V](m: Map[K, V], n: Int): Option[(K, V)] \x3d\n  internal::getIndex(m.tree, n)\n\n/// Construct a new map which contains all elements of `m1`\n/// except those where the key is found in `m2`.\n/// Uses an explicit pure, first-class comparison function.\n///\n/// O(???)\ndef difference[K, V](m1: Map[K, V], m2: Map[K, V], compare: (K, K) \x3d\x3e Ordering at {}) \x3d {\n  val newTree \x3d internal::difference(m1.tree, m2.tree, compare)\n  Map(newTree, compare)\n}\n\n/// Construct a new map which contains all elements of `m1`\n/// except those where the key is found in `m2`.\n/// Uses the comparison function from `m1`.\n///\n/// O(???)\ndef difference[K, V](m1: Map[K, V], m2: Map[K, V]) \x3d {\n  val newTree \x3d internal::difference(m1.tree, m2.tree, m1.compare)\n  Map(newTree, m1.compare)\n}\n\n/// Construct a new map which contains the elements of both `m1` and `m2`.\n/// When a key is associated with a value in both `m1` and `m2`, the new value is determined using the `combine` function.\n/// Uses an explicit pure, first-class comparison function.\n///\n/// O(???)\ndef union[K, V](m1: Map[K, V], m2: Map[K, V], compare: (K, K) \x3d\x3e Ordering at {}) { combine: (K, V, V) \x3d\x3e V }: Map[K, V] \x3d {\n  val newTree \x3d internal::union(m1.tree, m2.tree, compare) {combine}\n  Map(newTree, compare)\n}\n\n/// Construct a new map which contains the elements of both `m1` and `m2`.\n/// When a key is associated with a value in both `m1` and `m2`, the new value is determined using the `combine` function.\n/// Uses an explicit pure, first-class comparison function.\n///\n/// O(???)\ndef union[K, V](m1: Map[K, V], m2: Map[K, V], compare: (K, K) \x3d\x3e Ordering at {}) { combine: (V, V) \x3d\x3e V }: Map[K, V] \x3d\n  union(m1, m2, compare) { (k, v1, v2) \x3d\x3e combine(v1, v2) }\n\n/// Construct a new map which contains the elements of both `m1` and `m2`.\n/// Left-biased: Uses values from `m1` if there are duplicate keys and\n/// uses the comparison function from `m1`.\n///\n/// O(???)\ndef union[K, V](m1: Map[K, V], m2: Map[K, V]): Map[K, V] \x3d\n  union[K, V](m1, m2, m1.compare) { (k, v1, v2) \x3d\x3e v1 }\n\n/// Construct a new map which combines all elements that are in both `m1` and `m2` using the `combine` function.\n///\n/// O(???)\ndef intersection[K, A, B, C](m1: Map[K, A], m2: Map[K, B], compare: (K, K) \x3d\x3e Ordering at {}) { combine: (K, A, B) \x3d\x3e C }: Map[K, C] \x3d {\n  val newTree \x3d internal::intersection(m1.tree, m2.tree, compare) {combine}\n  Map(newTree, compare)\n}\n\n/// Construct a new map which combines all elements that are in both `m1` and `m2` using the `combine` function.\n///\n/// O(???)\ndef intersection[K, A, B, C](m1: Map[K, A], m2: Map[K, B], compare: (K, K) \x3d\x3e Ordering at {}) { combine: (A, B) \x3d\x3e C }: Map[K, C] \x3d\n  m1.intersection[K, A, B, C](m2, compare) { (k, v1, v2) \x3d\x3e combine(v1, v2) }\n\n/// Construct a new map which combines all elements that are in both `m1` and `m2`.\n/// Left-biased: Always uses values from `m1` and the comparison function from `m1`.\n///\n/// O(???)\ndef intersection[K, A, B](m1: Map[K, A], m2: Map[K, B]): Map[K, A] \x3d\n  m1.intersection[K, A, B, A](m2, m1.compare) { (k, v1, v2) \x3d\x3e v1 }\n\n/// Please don\'t directly use:\n/// - the `Tree` type\n/// - its internal constructors `Bin` \x26 `Tip`,\n/// - and these functions.\n/// As they might change down the line and are not considered stable / public.\nnamespace internal {\n  /// Balanced binary trees of logarithmic depth.\n  type Tree[K, V] {\n    Bin(size: Int, k: K, v: V, left: Tree[K, V], right: Tree[K, V]);\n    Tip()\n  }\n\n  /// Create a new empty tree.\n  ///\n  /// O(1)\n  def empty[K, V](): Tree[K, V] \x3d Tip()\n\n  /// Check if tree `m` is empty.\n  ///\n  /// O(1)\n  def isEmpty[K, V](m: Tree[K, V]): Bool \x3d\n    m match {\n      case Tip() \x3d\x3e true\n      case _     \x3d\x3e false\n    }\n\n  /// Check if tree `m` is nonempty.\n  ///\n  /// O(1)\n  def nonEmpty[K, V](m: Tree[K, V]): Bool \x3d\n    m match {\n      case Tip() \x3d\x3e false\n      case _     \x3d\x3e true\n    }\n\n  /// Create a new tree containing only the mapping from `k` to `v`.\n  ///\n  /// O(1)\n  def singleton[K, V](k: K, v: V): Tree[K, V] \x3d\n    Bin(1, k, v, Tip(), Tip())\n\n  /// Get the size of the tree (the number of keys/values).\n  ///\n  /// O(1)\n  def size[K, V](m: Tree[K, V]): Int \x3d\n    m match {\n      case Tip() \x3d\x3e 0\n      case Bin(size, _, _, _, _) \x3d\x3e size\n    }\n\n  /// Insert a new key `k` and value `v` into the tree `m`.\n  /// If the key `k` is already present in `m`, its associated value is replaced with `v`.\n  ///\n  /// O(log N)\n  def put[K, V](m: Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {}, k: K, v: V): Tree[K, V] \x3d\n    m match {\n      case Tip() \x3d\x3e singleton(k, v)\n      case Bin(size, k2, v2, l, r) \x3d\x3e\n        compare(k, k2) match {\n          case Less() \x3d\x3e balance(k2, v2, put(l, compare, k, v), r)\n          case Greater() \x3d\x3e balance(k2, v2, l, put(r, compare, k, v))\n          case Equal() \x3d\x3e Bin(size, k, v, l, r)\n        }\n    }\n\n  /// Insert a new key `k` and value `v` into the tree `m`.\n  /// If the key `k` is already present in `m` with value `v2`, the function `combine` is called on `k`, `v`, `v2`.\n  ///\n  /// O(log N)\n  def putWithKey[K, V](m: Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {}, k: K, v: V) { combine: (K, V, V) \x3d\x3e V } : Tree[K, V] \x3d\n    m match {\n      case Tip() \x3d\x3e singleton(k, v)\n      case Bin(size, k2, v2, l, r) \x3d\x3e\n        compare(k, k2) match {\n          case Less() \x3d\x3e balance(k2, v2, l.putWithKey(compare, k, v){combine}, r)\n          case Greater() \x3d\x3e balance(k2, v2, l, r.putWithKey(compare, k, v){combine})\n          case Equal() \x3d\x3e Bin(size, k, combine(k, v, v2), l, r)\n        }\n    }\n\n  /// Lookup the value at a key `k` in the tree `m`.\n  ///\n  /// O(log N)\n  def get[K, V](m: Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {}, k: K): Option[V] \x3d\n    m match {\n      case Tip() \x3d\x3e None()\n      case Bin(size, k2, v, l, r) \x3d\x3e\n        compare(k, k2) match {\n          case Less() \x3d\x3e get(l, compare, k)\n          case Greater() \x3d\x3e get(r, compare, k)\n          case Equal() \x3d\x3e Some(v)\n        }\n    }\n\n  /// Get minimum in the tree `m`.\n  ///\n  /// O(log N)\n  def getMin[K, V](m: Tree[K, V]): Option[(K, V)] \x3d {\n    def go(k: K, v: V, m: Tree[K, V]): (K, V) \x3d {\n      m match {\n        case Tip() \x3d\x3e (k, v)\n        case Bin(_, k2, v2, l, _) \x3d\x3e go(k2, v2, l)\n      }\n    }\n\n    m match {\n      case Tip() \x3d\x3e None()\n      case Bin(_, k, v, l, _) \x3d\x3e Some(go(k, v, l))\n    }\n  }\n\n  /// Get maximum in the tree `m`.\n  ///\n  /// O(log N)\n  def getMax[K, V](m: Tree[K, V]): Option[(K, V)] \x3d {\n    def go(k: K, v: V, m: Tree[K, V]): (K, V) \x3d {\n      m match {\n        case Tip() \x3d\x3e (k, v)\n        case Bin(_, k2, v2, _, r) \x3d\x3e go(k2, v2, r)\n      }\n    }\n\n    m match {\n      case Tip() \x3d\x3e None()\n      case Bin(_, k, v, _, r) \x3d\x3e Some(go(k, v, r))\n    }\n  }\n\n  /// Forgets the values of a tree, setting them all to `(): Unit`.\n  /// Used by `set`s internally.\n  ///\n  /// Law: `m.forget \x3d\x3d\x3d m.map { (_k, _v) \x3d\x3e () }`\n  ///\n  /// O(N)\n  def forget[K, V](m: Tree[K, V]): Tree[K, Unit] \x3d\n    m match {\n      case Tip() \x3d\x3e Tip()\n      case Bin(size, k, v, l, r) \x3d\x3e\n        Bin(size, k, (), l.forget, r.forget)\n    }\n\n  /// Tree a function `f` over values in tree `m`.\n  ///\n  /// O(N)\n  def map[K, V1, V2](m: Tree[K, V1]) { f : (K, V1) \x3d\x3e V2 }: Tree[K, V2] \x3d\n    m match {\n      case Tip() \x3d\x3e Tip()\n      case Bin(size, k, v, l, r) \x3d\x3e\n        Bin(size, k, f(k, v), l.map {f}, r.map {f})\n    }\n\n  /// Tree a function `f` over values in tree `m`, keeping only the values where `f` returns `Some(...)`\n  ///\n  /// O(N)\n  def mapMaybe[K, V1, V2](m: Tree[K, V1]) { f : (K, V1) \x3d\x3e Option[V2] }: Tree[K, V2] \x3d\n    m match {\n      case Tip() \x3d\x3e Tip()\n      case Bin(size, k, v, l, r) \x3d\x3e f(k, v) match {\n        case Some(v2) \x3d\x3e link(k, v2, l.mapMaybe {f}, r.mapMaybe {f})\n        case None() \x3d\x3e link2(l.mapMaybe {f}, r.mapMaybe {f})\n      }\n    }\n\n  /// Filters a tree `m` with a `shouldKeep` function,\n  /// keeping only the elements where `shouldKeep` returns `true`.\n  ///\n  /// Law: `m.filter { f } \x3d\x3d\x3d m.mapMaybe { (k, v) \x3d\x3e if (f(k, v)) Some(v) else None() }`\n  ///\n  /// O(N)\n  def filter[K, V](m: Tree[K, V]) { shouldKeep: (K, V) \x3d\x3e Bool }: Tree[K, V] \x3d {\n    def go(tree: Tree[K, V]): (Tree[K, V], Bool) \x3d tree match {\n      case Tip() \x3d\x3e (Tip(), false)\n      case Bin(size, k, v, l, r) \x3d\x3e\n        val (l2, lchanged) \x3d go(l)\n        val (r2, rchanged) \x3d go(r)\n        if (shouldKeep(k, v)) {\n          val changed \x3d lchanged || rchanged\n          val tree2 \x3d if (changed) {\n            link(k, v, l2, r2)\n          } else {\n            tree\n          }\n          (tree2, changed)\n        } else {\n          (link2(l2, r2), true)\n        }\n    }\n\n    go(m).first\n  }\n\n  /// Traverse all keys and their associated values in tree `m` in order,\n  /// running the function `action` on a key and its associated value.\n  ///\n  /// Law: `m.foreach { action } \x3d\x3d\x3d m.toList.foreach { action }`\n  ///\n  /// O(N)\n  ///\n  /// TODO: Support {Control} for early exits.\n  def foreach[K, V](m: Tree[K, V]) { action: (K, V) \x3d\x3e Unit }: Unit \x3d {\n    def go(m: Tree[K, V]): Unit \x3d {\n      m match {\n        case Tip() \x3d\x3e ()\n        case Bin(_, k, v, l, r) \x3d\x3e\n          go(l)\n          action(k, v)\n          go(r)\n      }\n    }\n    go(m)\n  }\n\n  /// Create a tree from a list of (key, value) pairs.\n  /// If the list contains more than one value for the same key,\n  /// only the last value is used in the tree.\n  ///\n  /// O(N) if the list is sorted by key,\n  /// O(N log N) otherwise\n  def fromList[K, V](pairs: List[(K, V)], compare: (K, K) \x3d\x3e Ordering at {}): Tree[K, V] \x3d {\n    pairs match {\n      case Nil() \x3d\x3e Tip()\n      case Cons((k, v), Nil()) \x3d\x3e singleton(k, v)\n      case Cons((k, v), rest) \x3d\x3e\n        // TODO: this function should really, **really** get inlined!\n        def notOrdered(k: K, pairs: List[(K, V)]) \x3d {\n          pairs match {\n            case Nil() \x3d\x3e false\n            case Cons((k2, _), _) \x3d\x3e  // k \x3e\x3d k2\n              compare(k, k2) match {\n                case Less() \x3d\x3e false\n                case Greater() \x3d\x3e true\n                case Equal() \x3d\x3e true\n              }\n          }\n        }\n\n        // Naive insertion, used for the worst-case scenario when the list is not sorted by key\n        def insertMany(m: Tree[K, V], pairs: List[(K, V)]) \x3d {\n          var treeSoFar \x3d m\n          pairs.foreach { case (k, v) \x3d\x3e\n            treeSoFar \x3d treeSoFar.put(compare, k, v)\n          }\n          treeSoFar\n        }\n\n        // Returns a triple `(tree, xs, ys)`\n        //\n        // Invariant: At least one of `xs`, `ys` is empty.\n        // Moreover, if `ys` is nonempty, its keys are **not** ordered!\n        // Otherwise, all of the seen keys have been ordered so far.\n        //\n        // TODO: Possibly use a better type to encode the invariant?\n        def create(level: Int, pairs: List[(K, V)]): (Tree[K, V], List[(K, V)], List[(K, V)]) \x3d {\n          pairs match {\n            case Nil() \x3d\x3e (Tip(), [], [])\n            case Cons((k, v), rest) \x3d\x3e\n              if (level \x3d\x3d 1) {\n                val singleton \x3d Bin(1, k, v, Tip(), Tip())\n                if (notOrdered(k, rest)) {\n                  (singleton, [], rest)\n                } else {\n                  (singleton, rest, [])\n                }\n              } else {\n                val res \x3d create(level.bitwiseShr(1), pairs)\n                res match {\n                  case (_, Nil(), _) \x3d\x3e res\n                  case (l, Cons((k2, v2), Nil()), zs) \x3d\x3e (l.putMax(k2, v2), [], zs)\n                  case (l, Cons((k2, v2), rest2), _) \x3d\x3e\n                    val xs \x3d Cons((k2, v2), rest2) // @-pattern\n\n                    if (notOrdered(k2, rest2)) { (l, [], xs) }\n                    else {\n                      val (r, zs, ws) \x3d create(level.bitwiseShr(1), rest2);\n                      (link(k2, v2, l, r), zs, ws)\n                    }\n                }\n              }\n          }\n        }\n\n        def go(level: Int, m: Tree[K, V], pairs: List[(K, V)]): Tree[K, V] \x3d {\n          pairs match {\n            case Nil() \x3d\x3e m\n            case Cons((k, v), Nil()) \x3d\x3e m.putMax(k, v)\n            case Cons((k, v), rest) \x3d\x3e\n              if (notOrdered(k, rest)) { insertMany(m, pairs) }\n              else {\n                val l \x3d m; // m is the left subtree here\n                val cr \x3d create(level, rest)\n                cr match {\n                  case (r, xs, Nil()) \x3d\x3e go(level.bitwiseShl(1), link(k, v, l, r), xs)\n                  case (r, Nil(), ys) \x3d\x3e insertMany(link(k, v, l, r), ys)\n                  case _ \x3d\x3e panic("create: go: cannot happen, invariant broken!")\n                }\n              }\n          }\n        }\n\n        if (notOrdered(k, rest)) { insertMany(singleton(k, v), rest) }\n        else { go(1, singleton(k, v), rest) }\n    }\n  }\n\n  /// Remove a key `k` from a tree `m`.\n  /// If `k` is not in `m`, `m` is returned.\n  ///\n  /// O(log N)\n  def delete[K, V](m: Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {}, k: K): Tree[K, V] \x3d\n    m match {\n      case Tip() \x3d\x3e Tip()\n      case Bin(_, k2, v2, l, r) \x3d\x3e\n        compare(k, k2) match {\n          case Less() \x3d\x3e balance(k2, v2, l.delete(compare, k), r)\n          case Greater() \x3d\x3e balance(k2, v2, l, r.delete(compare, k))\n          case Equal() \x3d\x3e glue(l, r)\n        }\n    }\n\n  /// Can be used to insert, delete, or update a value.\n  /// Law: `get(m.alter(k){f}, k) \x3d\x3d\x3d f(get(m, k))`\n  ///\n  /// O(log N)\n  def alter[K, V](m: Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {}, k: K) { f: Option[V] \x3d\x3e Option[V] }: Tree[K, V] \x3d\n    m match {\n      case Tip() \x3d\x3e\n        f(None()) match {\n          case None() \x3d\x3e Tip()\n          case Some(v) \x3d\x3e singleton(k, v)\n        }\n      case Bin(size, k2, v2, l, r) \x3d\x3e\n        compare(k, k2) match {\n          case Less() \x3d\x3e balance(k2, v2, l.alter(compare, k){f}, r)\n          case Greater() \x3d\x3e balance(k2, v2, l, r.alter(compare, k){f})\n          case Equal() \x3d\x3e\n            f(Some(v2)) match {\n              case Some(v) \x3d\x3e Bin(size, k2, v, l, r)\n              case None() \x3d\x3e glue(l, r)\n            }\n        }\n    }\n\n  /// Update or delete a value associated with key `k` in tree `m`.\n  ///\n  /// O(log N)\n  def update[K, V](m: Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {}, k: K) { f: (K, V) \x3d\x3e Option[V] }: Tree[K, V] \x3d\n    m match {\n      case Tip() \x3d\x3e Tip()\n      case Bin(size, k2, v2, l, r) \x3d\x3e\n        compare(k, k2) match {\n          case Less() \x3d\x3e balance(k2, v2, l.update(compare, k){f}, r)\n          case Greater() \x3d\x3e balance(k2, v2, l, r.update(compare, k){f})\n          case Equal() \x3d\x3e\n            f(k2, v2) match {\n              case Some(v) \x3d\x3e Bin(size, k2, v, l, r)\n              case None() \x3d\x3e glue(l, r)\n            }\n        }\n    }\n\n  /// Get `n`-th (key, value) pair in the tree `m`.\n  ///\n  /// O(log N)\n  def getIndex[K, V](m: Tree[K, V], n: Int): Option[(K, V)] \x3d\n    m match {\n      case Tip() \x3d\x3e None()\n      case Bin(size, k, v, l, r) \x3d\x3e\n        val sizeL \x3d l.size()\n        compareInt(sizeL, n) match {\n          case Less() \x3d\x3e r.getIndex(n - (sizeL + 1))\n          case Greater() \x3d\x3e l.getIndex(n)\n          case Equal() \x3d\x3e Some((k, v))\n        }\n    }\n\n  /// Construct a new tree which contains all elements of `m1`\n  /// except those where the key is found in `m2`.\n  ///\n  /// O(???)\n  def difference[K, V](m1: Tree[K, V], m2: Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {}): Tree[K, V] \x3d\n    (m1, m2) match {\n      case (Tip(), m2) \x3d\x3e Tip()\n      case (m1, Tip()) \x3d\x3e m1\n      case (m1, Bin(_, k, _, l2, r2)) \x3d\x3e\n        val (l1, _, r1) \x3d m1.splitLookup(compare, k)\n        val leftDiff \x3d l1.difference(l2, compare)\n        val rightDiff \x3d r1.difference(r2, compare)\n        if ((leftDiff.size() + rightDiff.size()) \x3d\x3d m1.size()) { m1 }\n        else { link2(leftDiff, rightDiff) }\n    }\n\n  /// Construct a new tree which contains the elements of both `m1` and `m2`.\n  /// When a key is associated with a value in both `m1` and `m2`, the new value is determined using the `combine` function.\n  ///\n  /// O(???)\n  def union[K, V](m1: Tree[K, V], m2: Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {}) { combine : (K, V, V) \x3d\x3e V }: Tree[K, V] \x3d {\n    /// Internal function similar to `putWithKey`, but right-biased. Only used here, recursively.\n    def putWithKeyR(m: Tree[K, V], k: K, v: V): Tree[K, V] \x3d {\n      m match {\n        case Tip() \x3d\x3e singleton(k, v)\n        case Bin(size, k2, v2, l, r) \x3d\x3e\n          compare(k, k2) match {\n            case Less() \x3d\x3e balance(k2, v2, l.putWithKeyR(k, v), r)\n            case Greater() \x3d\x3e balance(k2, v2, l, r.putWithKeyR(k, v))\n            case Equal() \x3d\x3e Bin(size, k, combine(k2, v2, v), l, r)\n          }\n      }\n    }\n\n    (m1, m2) match {\n      case (_, Tip()) \x3d\x3e m1\n      case (_, Bin(_, k, v, Tip(), Tip())) \x3d\x3e m1.putWithKeyR(k, v)\n      case (Bin(_, k, v, Tip(), Tip()), _) \x3d\x3e m2.putWithKey(compare, k, v){combine}\n      case (Tip(), _) \x3d\x3e m2\n      case (Bin(_, k1, v1, l1, r1), _) \x3d\x3e\n        val (l2, optMid, r2) \x3d m2.splitLookup(compare, k1)\n        val leftUnion \x3d union(l1, l2, compare){combine}\n        val rightUnion \x3d union(r1, r2, compare){combine}\n        optMid match {\n          case None() \x3d\x3e link(k1, v1, leftUnion, rightUnion)\n          case Some(v2) \x3d\x3e link(k1, combine(k1, v1, v2), leftUnion, rightUnion)\n        }\n    }\n  }\n\n  /// Construct a new tree which combines all elements that are in both `m1` and `m2` using the `combine` function.\n  ///\n  /// O(???)\n  def intersection[K, A, B, C](m1: Tree[K, A], m2: Tree[K, B], compare: (K, K) \x3d\x3e Ordering at {}) { combine: (K, A, B) \x3d\x3e C }: Tree[K, C] \x3d\n    (m1, m2) match {\n      case (Tip(), _) \x3d\x3e Tip()\n      case (_, Tip()) \x3d\x3e Tip()\n      case (Bin(_, k, v1, l1, r1), _) \x3d\x3e\n        val (l2, mid, r2) \x3d m2.splitLookup(compare, k)\n        val left \x3d l1.intersection(l2, compare) { combine }\n        val right \x3d r1.intersection(r2, compare) { combine }\n        mid match {\n          case Some(v2) \x3d\x3e link(k, combine(k, v1, v2), left, right)\n          case None() \x3d\x3e link2(left, right)\n        }\n    }\n\n  // -------------\n  // Internal\n\n  val ratio \x3d 2\n  val delta \x3d 3\n\n  def bin[K, V](k: K, v: V, l: Tree[K, V], r: Tree[K, V]): Tree[K, V] \x3d {\n    Bin(l.size() + r.size() + 1, k, v, l, r)\n  }\n\n  def balance[K, V](k: K, v: V, l: Tree[K, V], r: Tree[K, V]): Tree[K, V] \x3d {\n    /*\n      k1-\x3ev1\n      /    \\\n      t1     m                    k2-\x3ev2\n            \x3d                   /      \\\n          k2-\x3ev2        ~\x3e    k1-\x3ev1    t3\n          /   \\               /    \\\n          t2    t3            t1    t2\n    */\n    def singleL[A, B](k1: A, v1: B, t1: Tree[A, B], m: Tree[A, B]): Tree[A, B] \x3d {\n      m match {\n        case Bin(_, k2, v2, t2, t3) \x3d\x3e bin(k2, v2, bin(k1, v1, t1, t2), t3)\n        case _ \x3d\x3e panic("impossible: singleL: Tip")\n      }\n    }\n\n    /*\n          k1-\x3ev1\n          /     \\\n        m      t3            k2-\x3ev2\n        \x3d                   /      \\\n      k2-\x3ev2        ~\x3e    t1       k1-\x3ev1\n        /   \\               /       /   \\\n      t1    t2            t1      t2    t3\n    */\n    def singleR[A, B](k1: A, v1: B, m: Tree[A, B], t3: Tree[A, B]): Tree[A, B] \x3d {\n      m match {\n        case Bin(_, k2, v2, t1, t2) \x3d\x3e bin(k2, v2, t1, bin(k1, v1, t2, t3))\n        case _ \x3d\x3e panic("impossible: singleR: Tip")\n      }\n    }\n\n    /*\n          k1-\x3ev1                     k3-\x3ev3\n        /      \\                   /      \\\n      t1        m                k1-\x3ev1    k2-\x3ev2\n                \x3d                /  \\      /   \\\n              k2-\x3ev2     ~\x3e     t1  t2    t3   t4\n              /     \\\n            k3-\x3ev3   t4\n            /  \\\n          t2    t3\n    */\n    def doubleL[A, B](k1: A, v1: B, t1: Tree[A, B], m: Tree[A, B]): Tree[A, B] \x3d {\n      m match {\n        case Bin(_, k2, v2, Bin(_, k3, v3, t2, t3), t4) \x3d\x3e\n          bin(k3, v3, bin(k1, v1, t1, t2), bin(k2, v2, t3, t4))\n        case _ \x3d\x3e panic("impossible: doubleL: Tip")\n      }\n    }\n\n    /*\n              k1-\x3ev1                  k3-\x3ev3\n              /      \\                /      \\\n              m      t4            k2-\x3ev2    k1-\x3ev1\n              \x3d                    /  \\      /   \\\n            k2-\x3ev2         ~\x3e     t1  t2    t3   t4\n          /     \\\n        t1      k3-\x3ev3\n                  /  \\\n                t2    t3\n    */\n    def doubleR[A, B](k1: A, v1: B, m: Tree[A, B], t4: Tree[A, B]): Tree[A, B] \x3d {\n      m match {\n        case Bin(_, k2, v2, t1, Bin(_, k3, v3, t2, t3)) \x3d\x3e\n          bin(k3, v3, bin(k2, v2, t1, t2), bin(k1, v1, t3, t4))\n        case _ \x3d\x3e\n          panic("impossible: doubleR: Tip")\n      }\n    }\n\n    def rotateL[A, B](k: A, v: B, l: Tree[A, B], r: Tree[A, B]): Tree[A, B] \x3d {\n      r match {\n        case Bin(_, _, _, rl, rr) and (rl.size() \x3c ratio * rr.size()) \x3d\x3e singleL(k, v, l, r)\n        case _ \x3d\x3e doubleL(k, v, l, r)\n      }\n    }\n    def rotateR[A, B](k: A, v: B, l: Tree[A, B], r: Tree[A, B]): Tree[A, B] \x3d {\n      l match {\n        case Bin(_, _, _, ll, lr) and (lr.size() \x3c ratio * ll.size()) \x3d\x3e singleR(k, v, l, r)\n        case _ \x3d\x3e doubleR(k, v, l, r)\n      }\n    }\n\n    val sizeL \x3d l.size()\n    val sizeR \x3d r.size()\n    val sizeCombined \x3d sizeL + sizeR + 1\n\n    if ((sizeL + sizeR) \x3c\x3d 1) { Bin(sizeCombined, k, v, l, r) }\n    else if (sizeR \x3e (delta * sizeL)) { rotateL(k, v, l, r) }\n    else if (sizeL \x3e (delta * sizeR)) { rotateR(k, v, l, r) }\n    else { Bin(sizeCombined, k, v, l, r)}\n  }\n\n  record MaxView[K, V](k: K, v: V, m: Tree[K, V])\n  record MinView[K, V](k: K, v: V, m: Tree[K, V])\n\n  def maxViewSure[K, V](k: K, v: V, l: Tree[K, V], r: Tree[K, V]): MaxView[K, V] \x3d\n    (l, r) match {\n      case (l, Tip()) \x3d\x3e MaxView(k, v, l)\n      case (l, Bin(_, kr, vr, rl, rr)) \x3d\x3e\n        val MaxView(km, vm, r2) \x3d maxViewSure(kr, vr, rl, rr)\n        MaxView(km, vm, balance(k, v, l, r2))\n    }\n\n  def minViewSure[K, V](k: K, v: V, l: Tree[K, V], r: Tree[K, V]): MinView[K, V] \x3d\n    (l, r) match {\n      case (Tip(), r) \x3d\x3e MinView(k, v, r)\n      case (Bin(_, kl, vl, ll, lr), r) \x3d\x3e\n        val MinView(km, vm, l2) \x3d minViewSure(kl, vl, ll, lr)\n        MinView(km, vm, balance(k, v, l2, r))\n    }\n\n  /// Internal: Glues two balanced trees (with respect to each other) together.\n  def glue[K, V](l: Tree[K, V], r: Tree[K, V]): Tree[K, V] \x3d\n    (l, r) match {\n      case (Tip(), r) \x3d\x3e r\n      case (l, Tip()) \x3d\x3e l\n      case (Bin(sizeL, kl, vl, ll, lr), Bin(sizeR, kr, vr, rl, rr)) \x3d\x3e\n        if (sizeL \x3e sizeR) {\n          val MaxView(km, m, l2) \x3d maxViewSure(kl, vl, ll, lr)\n          balance(km, m, l2, r)\n        } else {\n          val MinView(km, m, r2) \x3d minViewSure(kr, vr, rl, rr)\n          balance(km, m, l, r2)\n        }\n    }\n\n  def splitLookup[K, V](m: Tree[K, V], compare: (K, K) \x3d\x3e Ordering at {}, k: K): (Tree[K, V], Option[V], Tree[K, V]) \x3d\n    m match {\n      case Tip() \x3d\x3e (Tip(), None(), Tip())\n      case Bin(_, k2, v2, l, r) \x3d\x3e\n        compare(k, k2) match {\n          case Less() \x3d\x3e\n            val (lessThan, mid, greaterThan) \x3d l.splitLookup(compare, k);\n            (lessThan, mid, link(k2, v2, greaterThan, r))\n          case Greater() \x3d\x3e\n            val (lessThan, mid, greaterThan) \x3d r.splitLookup(compare, k);\n            (link(k2, v2, l, lessThan), mid, greaterThan)\n          case Equal() \x3d\x3e (l, Some(v2), r)\n        }\n    }\n\n  def link[K, V](k: K, v: V, l: Tree[K, V], r: Tree[K, V]): Tree[K, V] \x3d {\n    (l, r) match {\n      case (Tip(), r) \x3d\x3e r.putMin(k, v)\n      case (l, Tip()) \x3d\x3e l.putMax(k, v)\n      case (Bin(sizeL, kl, vl, ll, lr), Bin(sizeR, kr, vr, rl, rr)) \x3d\x3e\n        if ((delta * sizeL) \x3c sizeR) { balance(kr, vr, link(k, v, l, rl), rr) }\n        else if ((delta * sizeR) \x3c sizeL) { balance(kl, vl, ll, link(k, v, lr, r)) }\n        else { bin(k, v, l, r) }\n    }\n  }\n\n  /// Internal: merge two trees\n  def link2[K, V](l: Tree[K, V], r: Tree[K, V]): Tree[K, V] \x3d\n    (l, r) match {\n      case (Tip(), r) \x3d\x3e r\n      case (l, Tip()) \x3d\x3e l\n      case (Bin(sizeL, kl, vl, ll, lr), Bin(sizeR, kr, vr, rl, rr)) \x3d\x3e\n        if ((delta * sizeL) \x3c sizeR) { balance(kr, vr, link2(l, lr), rr) }\n        else if ((delta * sizeR) \x3c sizeL) { balance(kl, vl, ll, link2(lr, r)) }\n        else { glue(l, r) }\n    }\n\n  def putMin[K, V](m: Tree[K, V], k: K, v: V): Tree[K, V] \x3d\n    m match {\n      case Tip() \x3d\x3e singleton(k, v)\n      case Bin(_, k2, v2, l, r) \x3d\x3e\n        balance(k2, v2, l.putMin(k, v), r)\n    }\n\n  def putMax[K, V](m: Tree[K, V], k: K, v: V): Tree[K, V] \x3d\n    m match {\n      case Tip() \x3d\x3e singleton(k, v)\n      case Bin(_, k2, v2, l, r) \x3d\x3e\n        balance(k2, v2, l, r.putMax(k, v))\n    }\n\n  // Section: for tests and invariants:\n\n  /// Check if a tree `m` is balanced.\n  def isBalanced[K, V](m: Tree[K, V]): Bool \x3d\n    m match {\n      case Tip() \x3d\x3e true\n      case Bin(_, _, _, l, r) \x3d\x3e\n        val bothSmall \x3d l.size() + r.size() \x3c\x3d 1\n        val leftSmallEnough \x3d l.size() \x3c\x3d delta * r.size()\n        val rightSmallEnough \x3d r.size() \x3c\x3d delta * l.size()\n        (bothSmall || (leftSmallEnough \x26\x26 rightSmallEnough)) \x26\x26 isBalanced(l) \x26\x26 isBalanced(r)\n    }\n\n  // Section: prettyprinting for trees:\n\n  /// Works only on the backends that support `genericShow` (JavaScript)!\n  def prettyTree[K, V](m: Tree[K, V]): String \x3d {\n    // Helper function to recursively build the string representation of the tree\n    def go(t: Tree[K, V], prefix: String, isTail: Bool): String \x3d {\n      t match {\n        case Tip() \x3d\x3e ""\n        case Bin(_, k, v, l, r) \x3d\x3e\n          val pair \x3d k.genericShow ++ " \u2192 " ++ v.genericShow\n          val currentLine \x3d prefix ++ (if (isTail) "\u2514\u2500\u2500 " else "\u251c\u2500\u2500 ") ++ pair ++ "\\n"\n\n          val newPrefix \x3d prefix ++ (if (isTail) "    " else "\u2502   ")\n          val leftStr \x3d go(l, newPrefix, false)\n          val rightStr \x3d go(r, newPrefix, true)\n\n          currentLine ++ leftStr ++ rightStr\n      }\n    }\n\n    // Start the recursion with the initial tree, an empty prefix, and true for the root being the tail\n    go(m, "", true)\n  }\n\n  def prettyPairs[K, V](list: List[(K, V)]) { showLeft: K \x3d\x3e String } { showRight: V \x3d\x3e String }: String \x3d {\n    val res: String \x3d\n      list.map { case (k, v) \x3d\x3e showLeft(k) ++ " \u2192 " ++ showRight(v) }\n          .join(", ")\n\n    "[" ++ res ++ "]"\n  }\n}');
pD("common/bench.effekt",'module bench\n\ntype Nanos \x3d Int\n\n/// The current time (since UNIX Epoch) in nanoseconds.\n///\n/// The actual precision varies across the different backends.\n/// - js: Milliseconds\n/// - chez: Microseconds\nextern io def timestamp(): Nanos \x3d\n  js "Date.now() * 1000000"\n  chez "(timestamp)"\n  llvm !!!MULTILINEMARKER!!!\n    %time_ptr \x3d alloca { i64, i64 }\n    call i32 @clock_gettime(i32 0, ptr %time_ptr)\n    %time \x3d load {i64, i64}, ptr %time_ptr\n    %time_seconds \x3d extractvalue {i64, i64} %time, 0\n    %time_nanoseconds \x3d extractvalue {i64, i64} %time, 1\n    %time_seconds_nanoseconds \x3d mul nsw i64 %time_seconds, 1000000000\n    %result \x3d add nsw i64 %time_seconds_nanoseconds, %time_nanoseconds\n    ret %Int %result\n  !!!MULTILINEMARKER!!!\n\nextern llvm !!!MULTILINEMARKER!!!\n  declare i32 @clock_gettime(i32, ptr)\n!!!MULTILINEMARKER!!!\n\n// This should not be needed when using NodeJS 16.x or newer.\nextern jsNode !!!MULTILINEMARKER!!!\n  const { performance } \x3d require(\'node:perf_hooks\');\n!!!MULTILINEMARKER!!!\n\n/// High-precision timestamp in nanoseconds that should be for measurements.\n///\n/// This timestamp should only be used for **relative** measurements,\n/// as gives no guarantees on the absolute time (unlike a UNIX timestamp).\nextern io def relativeTimestamp(): Nanos \x3d\n  js "Math.round(performance.now() * 1000000)"\n  default { timestamp() }\n\ntype Duration \x3d Int\n\nnamespace Duration {\n  def diff(fromNanos: Nanos, toNanos: Nanos): Duration \x3d toNanos - fromNanos\n}\n\n/// Runs the block and returns the time in nanoseconds\ndef timed { block: \x3d\x3e Unit }: Duration \x3d {\n  val before \x3d relativeTimestamp()\n  block()\n  val after \x3d relativeTimestamp()\n  Duration::diff(before, after)\n}\n\ndef measure(warmup: Int, iterations: Int) { block: \x3d\x3e Unit }: Unit \x3d {\n  def run(n: Int, report: Bool): Unit \x3d {\n    if (n \x3c\x3d 0) { () } else {\n      val time \x3d timed { block() };\n      if (report) { println(time) } else { () };\n      run(n - 1, report)\n    }\n  }\n  run(warmup, false)\n  run(iterations, true)\n}\n\n/// Takes a duration in nanoseconds and formats it in milliseconds with precision of two decimal digits.\ndef formatMs(nanos: Nanos): String \x3d {\n  val micros \x3d nanos / 1000000\n  val sub \x3d (nanos.mod(1000000).toDouble / 10000.0).round\n\n  if (sub \x3d\x3d 100) {\n    // overflow because of rounding\n    (micros + 1).show ++ ".0ms"\n  } else {\n    micros.show ++ "." ++ sub.show ++ "ms"\n  }\n}\n');
